INSERT INTO `game_softs` (`id`, `name`, `phonetic`, `phonetic2`, `phonetic_type`, `phonetic_order`, `genre`, `series_id`, `order_in_series`, `original_package_id`, `introduction`, `introduction_from`, `created_at`, `updated_at`) VALUES
(1, '零～zero～', 'ぜろ', 'ぜろ10', 3, 149, 'アクションアドベンチャー', 2, 1, 32, '舞台は、廃墟となった日本家屋「氷室邸」。\r\nプレイヤーは、懐中電灯の明かりだけを頼りに、氷室邸を探索していきます。\r\n障子の裏に、床下に、天井の梁の上に潜む\"何か\"の気配。\r\n懐中電燈の光の中に不意に浮かび上がる影・・・\r\n光と闇が新たな恐怖を織り成します。', '<a href=\"http://www.tecmo.co.jp/product/zero/index2.htm\" target=\"_blank\"><cite title=\"公式サイト\">公式サイト</cite></a>', '2018-03-24 01:17:50', '2018-03-24 01:22:05'),
(3, '零～紅い蝶～', 'ぜろあかいちょう', 'ぜろ20', 3, 150, 'アクションアドベンチャー', 2, 2, 35, '双子の少女が迷い込んだのは・・地図から消えた村\r\n祭りの日　その村は消えた\r\n永遠に続く祭りの夜\r\nその祭りでは　双子が贄とされた\r\n迫る儀式の刻\r\n姉が　妹を　殺す儀式…', '<a href=\"https://www.youtube.com/watch?v=8Wh2bhphpAc\" target=\"_blank\">公式PV</a>', '2018-03-24 01:17:50', '2018-03-24 01:22:05'),
(5, '零～刺青ノ聲～', 'ぜろしせいのこえ', 'ぜろ30', 3, 151, 'アクションアドベンチャー', 2, 3, 38, 'あの日以来、毎晩同じ屋敷に迷い込む夢を見る。\r\n”眠りの家”と呼ばれるその屋敷には、この世のものではない存在達――怨霊が彷徨っていた…\r\n\r\n死んでしまったはずのあの人の姿を見た\r\nあの屋敷の謎を解明すれば、もう一度会えるかもしれない…\r\n黒澤怜は、浮かび上がった写真を手掛かりに、現実の世界で調査を進めていくことになる。', '<a href=\"http://www.tecmo.co.jp/product/zero3/\" target=\"_blank\"><cite title=\"公式サイト\">公式サイト</cite></a>', '2018-03-24 01:17:50', '2018-03-24 01:22:05'),
